import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';


import ListServers from './components/ListServers'; // Updated import path
import AddServer from './components/AddServer'; // Updated import path
import DeleteServer from './components/DeleteServer'; // Updated import path

function App() {
  return (
    <Router>
      <div className="App">
        {/* No Navigation component */}
        <Routes>
          <Route path="/" element={<ListServers />} />
          <Route path="/add" element={<AddServer />} />
          <Route path="/delete/:id" element={<DeleteServer />} />
          {/* Add more routes as needed */}
        </Routes>
      </div>
    </Router>
  );
}


export default App;
